import React, { Component } from 'react';

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Jumbotron from 'react-bootstrap/Jumbotron'
import Button from 'react-bootstrap/Button'

import Background from '../assets/headerBackground.jpg'

const styles = {
	background: {
		backgroundImage: `url(${Background})`
	},
	jumbotron: {
		height: '100vh',
		width: '100vw'
	}
}

class Header extends Component {
  render() {

    return (
		<section id="header" style = {styles.background}>
			<Jumbotron fluid style = {styles.jumbotron}>
				<Container fluid>
				</Container>
				<Row>
					<Col>
						<h1>Jacob Makarsky</h1>
						<p>
							State College based Software Engineer & Entrepreneur. 
							Co-Founder of LiveBet, Partner at Digital Wealth Management.
						</p>
						<p>
							<Button variant="primary">Learn more</Button>
						</p>
					</Col>
				</Row>
			</Jumbotron>
		</section>
    );
  }
}

export default Header;
